des:
Team Picker is used to manage a team and randomly select someone from the team. You can add, remove, and randomly pick someone from the team. You can also clear the team and ask for who all is on the team.
Add person - Add {person}
Remove person - Remove {person}
Clear team - Clear team ,Erase team
List team - Who is on my team, whats my team
Pick someone - Pick someone, Randomly pick someone
